import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import TaskList from "./components/TaskList";
import AddTaskForm from "./components/AddTaskForm";
import "./App.css"; // Make sure to import your CSS file

function App() {
  return (
    <Router>
      <header>
        <nav>{/* Navigation bar content here */}</nav>
      </header>
      <main>
        <section className="hero">
          {/* Hero content with a compelling headline */}
        </section>
        <section className="features">{/* Features of your app */}</section>
        <section className="testimonials">{/* User testimonials */}</section>
        <section className="about">{/* About the app */}</section>
        <section className="contact">{/* Contact form */}</section>
      </main>
      <footer>{/* Footer content */}</footer>
      <Routes>
        <Route path="/tasks" element={<TaskList />} />
        <Route path="/add-task" element={<AddTaskForm />} />
      </Routes>
    </Router>
  );
}

export default App;
